import React from "react";
import { Box, Image } from "@chakra-ui/core";

const CheckIn = () => {
  return (
    <Box>
      <Image src="../../assets/images/check-in.png" height="auto" w="auto" />
    </Box>
  );
};

export default CheckIn;
